  def parse_grammar(grammar):
    """
    Parses the grammar.
    """
    grammar_dict = {}
    for rule in grammar:
      group = rule.strip()
      if group:
        if group not in grammar_dict:
          grammar_dict[group] = []
        grammar_dict[group].append(rule)
    return grammar_dict

